DROP TABLE IF EXISTS `t_jenistabungan`;
CREATE TABLE `t_jenistabungan` (
  `kode_tabungan` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL DEFAULT '' COMMENT 'TRIAL',
  `nama_tabungan` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'TRIAL',
